import React from 'react';
import logo_text_dark from '../../assets/images/logo_text_dark.png';
import logo_text_light from '../../assets/images/logo_text_light.png';

const variants = {
    colors: {
        black: logo_text_light,
        white: logo_text_dark,
    },
    // size: {
    //     "64":
    // }
}

const Logo = ({ color="white" , size, astext,  }) => {

    const src = variants.colors[color];   

    // if (size) classNames.push('font-bold')
    // if (astext) classNames.push(`text-`)

    return (
        <div>
            <img
                src={src}
                alt="Alternate Text"
            />

        </div>
    );
}

Logo.prototype = {
    bold: PropTypes.bool,
    textAlign: 'left' | 'center',
    size: "sm" | "md",
    color: "black" | "white" | "red" ,
    fontStyle: "light",
    bg: "neutral-900"
}

export default Logo;
